import Box from '@material-ui/core/Box';
import { validateCategoryCreation } from './categoryValidation';
import { useStyles } from './useStyles';
import SimpleForm from 'components/SimpleForm';

export const CategoryCreate = (props: any) => {
  const classes = useStyles();
  return (
    <Create {...props} className={classes.createBox}>
      <SimpleForm validate={validateCategoryCreation}>
        <Box className={classes.fields}>
          <TextInput fullWidth source="code" options={ 
            {label:"Código"}
          } className={classes.input} />
          <TextInput fullWidth source="description" className={classes.input} />
        </Box>
      </SimpleForm>
    </Create>
  );
};
